import "@openzeppelin/contracts/utils/Strings.sol";


contract oddEve{
    uint public score;
    bool public out;
    uint randomvariable;

    constructor()
    {
        score = 0;
        out=false;
        randomvariable=1;
    }
    
    function takeinput(uint _inputnumber) public returns (string memory stringg){
        
        if (out==true)
        {
            return "BatsmanIsOut.";
        }
        else
        {
            uint randomnumber =randdomnumbergenerator();
            if (_inputnumber<1 || _inputnumber >6){
                return "EnterValidNumber";
            }
            
            else if (out==false)
            {
                if (randomnumber==0)
                    randomnumber=6;

                if (randomnumber==_inputnumber)
                {
                    stringg = Strings.toString(score);
                    out=true;
                    return stringg;	//yet to implement

                }
                else
                {
                    score = score + randomnumber;
                    stringg = Strings.toString(score);
                    return "randonumber RUNS";	//yet to implement
                }
            }
        }
    }

    function randdomnumbergenerator() private returns(uint)
    {
    // increase nonce
        unchecked{
            randomvariable++;
        } 
        return uint(keccak256(abi.encodePacked(block.timestamp, score, randomvariable))) % 6;
    }

    function reset() public returns(string memory)
    {
        score = 0;
        out=false;
        
        return "RESET Successfully";
    }
    
    function concatenate(string memory a,string memory b) private pure returns (string memory){
        return string(bytes.concat(bytes(a), " ", bytes(b)));
    } 
}

